export * from "./Join"
try {
    // @ts-ignore
    Join.displayName = "Join";
    // @ts-ignore
    Join.__docgenInfo = { "description": "`Join` is a higher order component that renders a separator component
between each of `Join`'s direct children.
@example <Join separator={<SomeComponent/>}>
   <child1/>
   <child2/>
   <child3/>
</Join>

which renders

<child1/>
<SomeComponent/>
<child2/>
<SomeComponent/>
<child3/>", "displayName": "Join", "props": { "separator": { "defaultValue": null, "description": "", "name": "separator", "required": true, "type": { "name": "any" } } } };
    // @ts-ignore
    if (typeof STORYBOOK_REACT_CLASSES !== "undefined")
        // @ts-ignore
        STORYBOOK_REACT_CLASSES["src/elements/Join/index.tsx#Join"] = { docgenInfo: Join.__docgenInfo, name: "Join", path: "src/elements/Join/index.tsx#Join" };
}
catch (__react_docgen_typescript_loader_error) { }
